/*body*/
body {
  margin: 0;
  padding: 0;
  width: 100%;
  font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
}
/*end body*/

/*header*/
#header{
  width:100%;
  margin-top: 20px;
  position: fixed;
}
#header {
  background: url(https://images.unsplash.com/photo-1528334713982-2d1fe11a157a?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1950&q=80) center center no-repeat;
  background-size: cover;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 23vh;
}
/*end header*/

/*nav*/
#nav > ul {
  display: flex;
  justify-content: space-evenly;
  padding: 0 0;
}
#nav ul{
  list-style: none;
  margin: 0 auto;
}
#nav > ul > li {
  display: inline-block;
  text-decoration: none;
  border: 1px solid;
  border-radius: 25px;
  padding: 1rem;
}
#nav{
  float:right;
  margin-top: 5px;
  width:900px;
}
#nav {
  display: flex;
  align-items: right;
  flex-direction: column;
}
#nav li {
  float:right;
  padding:0 10px;
  border:1px solid blue;
  margin: 2px;
  background-color: black;
}
#nav li a {
  text-decoration: none;
  font-size: 1em;
  color: grey;
}
#nav li a.active {
  border-bottom:3px solid red;
}
#nav li a:hover {
  color:blueviolet;
}
nav > i {
  padding: 1rem;
  font-size: 2em;
}
nav > .fa-bars {
}
.logo .navbar-logo img{
  padding: 0.5rem;
  flex-direction: column;
  display: block;
  height: auto;
  width: 15%;
  margin: auto;
}
.logo .navbar-logo img{
float: left;
}
/*end nav*/


/*about*/
.about-img img{
  height: 85px;
  width: 102px;
  padding:0.5rem;
}
#About{
  padding: 10em 10em;
}
#About{
  background:url('img/portfolio/g5.svg');
  background-size:cover;
}
#About {
  margin-right: 3rem;
}
#About img {
  float: left;
  width: 25%;
  height: auto;
  margin-right: 2rem;
}
#About {
    height: 60vh;
}
#bio {
  margin: 1rem;
}
#bio img {
  float: left;
  width: 40%;
  height: auto;
  margin-right: 1rem;
}

/*end about*/

/*skills*/
#Skills{
  padding: 10rem 10rem;
}
#Skills {
  margin-right: 3rem;
}

#Skills {
  background: url('img/portfolio/g5.svg');
  background-size: cover;
}
#Skills p{
  padding: 1rem 7rem;
  font-size: 14px;
}

#Skills .skills .skills-img{
  background: #ffffff10;
  box-shadow: var(--box-shadow);
  margin: 3rem 0rem;
  padding: 2rem;
  display: flex;
  justify-content: center;
  padding: 0 1.5rem;
}
#Skills .wrap h4{
  font: normal 700 25px/12px;
  padding: 1rem 7rem;
  font-size: 18px;
  text-justify: left;
}
#Skills .wrap h1{
  font: normal 700 25px/12px;
  padding: 1rem 7rem;
  font-size: 18px;
  text-justify: left;
}
#Skills .skills .title h4{
  font: normal 700 25px/12px;
  padding: 1rem 7rem;
  font-size: 14px;
  text-justify: center;
}
/*end skills*/

/*gallery*/
.gallery{
  margin: 10px 50px;
}
.gallery img{
  transition: 1s;
  padding: 15px;
  width: 200px;
}
.gallery img:hover{
  filter: grayscale(100%);
  transform: scale(1.1);
}
#Gallery .gallery{
  display: flex;
  flex-direction: column;
  align-items: center;
}
#Gallery .gallery{
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(33%, 1fr));
  background-color: white;
}
#Gallery {
  border: solid 1px black;
  clear: both;
}
#Gallery .button-group button + button{
  background: transparent;
  border: none;
  font: normal 500 16px/130px var(--roboto);
  text-transform: uppercase;
  padding: 1.5rem;
  display: row;
  justify-content: center;
  margin-right: 3rem;
}
#Gallery .button-group button{
  background: transparent;
  border: none;
  font: normal 500 16px/130px var(--roboto);
  text-transform: uppercase;
  padding: 1.5rem;
  display: row;
  justify-content: center;
  margin-right: 3rem;
}
#Gallery .gallery .pro img{
  display: flex;
  justify-content: center;
  padding: 1.8rem 1.5rem;
  margin: .9rem 0;
  width: 180px;
  height: 100px;
  cursor: pointer;
}
/*end gallery*/

/*nasa*/
#NASA {
  padding: 10rem 10rem;
  margin: 3rem auto;
}
@media (min-width: 550px){
  #NASA {
    height: 63vh;
  }
}
#NASA .nasa h1{
  text-justify: center;
}
/*end nasa*/

/*register*/
#Resister {
  background: url('img/portfolio/g3.svg');
  background-size: cover;
  display: flex;
  justify-content: center;
  padding: 0 1.5rem;
}
#Register {
  padding: 10rem 10rem;
  margin: 3rem auto;
}
#Register h3{
  font: normal 700 30px/ 30px;
  color: teal;
}
#Regster form .input-textbox input{
  width: 400px;
  padding: 1.5rem 1rem;
  border: 1px solid whitesmoke;
  background: transparent;
  color: blue;
  font: normal 500 17px/20px;
}
/*end register*/
/*form*/
form .input-textbox input::placeholder{
  color: whitesmoke;
}
form .btn-submit button{
  background: whitesmoke;
  color: #000;
  padding: .7rem 2rem;
}
form {
  border: solid 1px black;
  display: flex;
  flex-direction: column;
  margin: 1rem 1rem;
}

form > * {
  margin: .5rem;
}
form > input[type=submit] {
  width: 40%;
  margin: .5rem;
  margin-right: auto;
}
/*end form/

/*login*/
#Login {
  background: url('img/portfolio/g6.svg');
  background-size: cover;
  display: flex;
  justify-content: center;
  padding: 0 1.5rem;
}
#Login {
  margin: 3rem auto;
}
#Login h3{
  font: normal 700 30px/ 30px;
  color: black;
}
#Login form .input-textbox input{
  width: 400px;
  padding: 1.5rem 1rem;
  border: 1px solid whitesmoke;
  background: transparent;
  color: pink;
  font: normal 500 17px/20px;
}
/*end login*/

/*footer*/
#footer{
  background-color: rebeccapurple;
  color: black;
  padding:20;
}
#footer{
  width: 100%;
  height: 65px;
  margin-top: auto;
  position: fixed;
}
footer {
  border-top: solid 1px black;
  padding: 2rem 2rem 4rem;
  margin: 1rem 1rem;
}
/*end footer*/



img {
  border: 4px solid black;
  margin: 5px;
}

.container{
  max-width:1040px;
  border:1px solid pink;
  margin:0 auto;
}
section{
  border:1px solid black;
  min-height: 500px;
  background-color:coral
}
.clear {
  clear:both;
}
.wrap {
  background-color:rgb(200,200,200);
  background-color:rgba(200,200,200,0.5);
  border-radius:20px;
  padding:20px;
  margin:40px auto;
  width:70%;
}
